●カーメイトのクルマを愛する大人のための上質なフレグランスブランド ブラング ネロ グランリキッド ナイトカクテル L563<br>●消臭剤を配合したドリンクホルダー専用のグランリキッドタイプ<br>●別売の詰め替え用フレグランスボトルを使用すれば交換が可能<br><br>☆ブラング ネロ ラインアップ<br>グランリキッドタイプ → L561 / L562 / L563<br>リキッドタイプ → L521 / L522 / L523 / L524<br>ゲルタイプ → G1101 / G1102 / G1103 / G1104<br>ソリッドタイプ → G1131 / G1132 / G1133 / G1134<br>エアスティックタイプ → H721 / H722 / H723<br>グランリキッドタイプ詰め替え用ボトル → L571 / L572 / L573<br><br>【仕様】<br>品名：BLANG NERO GRAND LIQUID NIGHT COCKTAIL<br>カラー：ブラック/ゴールド(BLACK/GOLD)<br>製品重量：330g<br>製品サイズ：H129×W82×D68(mm)<style type="text/css">
